import React from 'react';
import Navbar from '../components/Navbar';

export default function Home() {
  return (
    <div className='home'>
      <Navbar />
      <form className='form'>
        <h1>Welcome at FILMIX</h1>

        <label>Get a free account today!</label>
        <input></input>
      </form>
    </div>
  )
}
